import React from 'react'

const AddWorker = () => {
  return (
    <form className='flex flex-col justify-center items-center gap-5'>
       <label className='font-bold' htmlFor="name">Çalışan İsmi</label>
       <input className='max-w-[30rem] w-full mx-auto text-center ' type="text" placeholder='Çalışan ismi Giriniz' id='name' />
       <label htmlFor="wage" className='font-bold'>Maaş Miktarı</label>
       <input className='max-w-[30rem] w-full text-center' type="number" placeholder='Maaş Miktarını Giriniz' id='wage' />  
        <button>Ekle</button>
    </form>
  )
}

export default AddWorker
